<ng-template #presentationModal let-modal>
  <div class="modal-header">
    <h4 class="modal-title" id="modal-basic-title">{{ presentedMember.alias }}</h4>
  </div>

  <div class="modal-body">
    <div class="container-fluid">
      <div class="row">
        <div class="col-md-6">
          <p><span>{{ presentedMember.grade }}</span></p>
          <p><span>{{ presentedMember.lastName}} {{ presentedMember.name}}</span></p>
          <p><span>{{ presentedMember.pole }}</span></p>
        </div>
        <div class="col-md-6 ml-auto">
          <img [src]="presentedMember.photo" id="presentationPicture" alt="Presentation Picture">
        </div>
      </div>
      <div class="row">
        <p><span>{{ presentedMember.description }}</span></p>
      </div>
    </div>
  </div>
</ng-template>
